import React from 'react'
import './BackDrop.css'
import ReactDom from 'react-dom'



export default function BackDrop(props) {
  document.getElementById('backDropRoot')
  
  return (
    ReactDom.createPortal(
    <div className='backDrop'>
    {props.children}
    </div>)
  )
}
